INSERT INTO "FACSHOPDB"."PRODUCT" (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('Датчик давления. тип OT-1. диапазон 0-6 bar. G1/4A DIN 3852-E 0-10 В, WIKA ALEXANDER WIEGAND SE & CO. KG',11076.00,'Производитель: WIKA ALEXANDER WIEGAND SE & CO. KG OEM преобразователи давления, тип OT-1. Особенности: Диапазоны измерения от 0 ... 6 бар до 0 ... 60 бар Выходные сигналы 4 ... 20 мА, 1 ... 5 В, 1 ... 6 В, 0 ... 10 В, 0,5 ... 4,5 В, логометрический @ 5 В Пылевлагозащита IP 67 Допустимы с быстрым присоединением Fixcon Полностью автоматическое производство в соответствие с ISO/TS 16 949 Присоединения к процессу G 1/4 DIN 3852-E Корпус изготовлен из высокопрочного фиберглассового пластика (PBT). Металлическая основа внутри корпуса обеспечивает хорошую защиту от электромагнитных излучений. Герметично заваренный, тензорезистивный датчик обладает долговременными характеристиками, в течение которых сохраняется герметичность, что позволяет не требовать дополнительных улотнительных устройств. Тензорезистивный датчик давления, изготовлен из высококачественной стали по технологии «распыления», обладает выской долговременной стабильностью характеристик, что находит свое применение в измерениях часто изменяемого давления. Применение: - Пневматика - Гидравлика - Автомобильная промышленность - Технологии охлаждения','davlenie1.jpg',1, CAST (X'' AS BLOB))
