INSERT INTO "FACSHOPDB"."PRODUCT" (NAME,PRICE,DESCRIPTION,IMG,CATEGORY_ID,IMG_SRC) VALUES ('Датчик уровня ДС.1, Овен',1440.00,'Датчики уровня кондуктометрического типа, предназначены для измерения и сигнализации уровней жидкостей. Принцип действия датчиков основан на изменении электропроводности между общим и сигнальными электродами в зависимости от уровня измеренного вещества. Для работы датчика необходимо приобрести контактные стержни подходящей длины.','urgid3.jpg',4, CAST (X'' AS BLOB))